import "../styles.css";    

export default function MainPage() {
    return (
        <header className="header">
            <a href="#" className="logo">Dana</a>
            <nav className="navbar">
                <a href="#">Home</a>
                <a href="#">About</a>
                <a href="#">Services</a>
                <a href="#">Portfolio</a>
                <a href="#">Contact</a>
            </nav>
        </header>
    )
}
